import React from "react";

const Navbar = ({children}) => {
    return(
        <div>
        <div className="NavHead">
            <div className="AppName">My App</div>
            <div className="Menu">
                <div>Sayoni</div>
                <div>Logout</div>
            </div>

        </div>
        {children}
        </div>
    )
}
export default Navbar;
